import React from 'react';
import { NavLink } from 'react-router-dom';



export class NavbarComponent extends React.Component<any> {
  constructor(props: any){
    super(props);
    this.state ={
        User : []
    }
  }

  removeUser = (u: any) => {
    this.setState({
      User: null,
    })
  }

  render() {
    return (
    <>
      {/* just writing the name of a prop is shorthand for prop={true}*/}
        {/* <NavbarBrand className="sublogo" href="/">Reimbursements</NavbarBrand> */}
        <ul>     
        { !this.props.User && <li><NavLink to="/login">login</NavLink></li>}          
          <li>
            <NavLink to="/hello">claim</NavLink>
          </li>
          <li>
            <NavLink to="/swapi">users</NavLink>
          </li>
          <li>
            <NavLink to="/books">books</NavLink>
          </li>
          { this.props.User && <li><span onClick={this.props.removeUser()}>logout</span></li>}
        </ul>
    </>
    )
    }
}
